import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { CustomerInvoicesComponent } from './customerInvoicesapp/customer-invoices/customer-invoices.component';
import { CustomerInvoicesListComponent } from './customerInvoicesapp/customer-invoices-list/customer-invoices-list.component';
import { CustomerInvoicesAppComponent } from './customerInvoicesapp/customer-invoices-app/customer-invoices-app.component';
import { FormsModule } from '@angular/forms';

import { HttpClientModule } from '@angular/common/http';

import { ToastrModule } from 'ngx-toastr';
import { CustomerInvoiceAddComponent } from './customerInvoicesapp/customer-invoice-add/customer-invoice-add.component';

@NgModule({
  declarations: [
    AppComponent,
    CustomerInvoicesComponent,
    CustomerInvoicesListComponent,
    CustomerInvoicesAppComponent,
    CustomerInvoiceAddComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    HttpClientModule,
    ToastrModule.forRoot()
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
